import React, { useState, useEffect, useContext, useCallback } from 'react';
import { useNavigate } from 'react-router-dom';
import { UserContext } from '../contexts/UserContext';
import '../styles/home.css';

const HomePage = () => {
    const { user, setUser } = useContext(UserContext);
    const [message, setMessage] = useState('');
    const [messages, setMessages] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const navigate = useNavigate();

    useEffect(() => {
        fetchMessages();
        const interval = setInterval(updateLocation, 30000); // Update location every 30 seconds
        return () => clearInterval(interval); // Clear interval on component unmount
    }, [user, updateLocation]);

    const fetchMessages = async () => {
        try {
            const response = await fetch('http://localhost:9000/api/messages');
            if (!response.ok) {
                throw new Error('Failed to fetch messages');
            }
            const data = await response.json();
            setMessages(data.reverse());
            setLoading(false);
        } catch (error) {
            console.error('Failed to fetch messages:', error);
            setError(error.message);
            setLoading(false);
        }
    };

    const getCurrentLocation = async () => {
        return new Promise((resolve, reject) => {
            if (navigator.geolocation) {
                navigator.geolocation.getCurrentPosition(
                    (position) => {
                        resolve({
                            type: 'Point',
                            coordinates: [position.coords.latitude, position.coords.longitude]
                        });
                    },
                    (error) => {
                        reject(error);
                    }
                );
            } else {
                reject(new Error('Geolocation is not supported by this browser.'));
            }
        });
    };

    const updateLocation = useCallback(async () => {
        try {
            if (user) {
                const location = await getCurrentLocation();
                const response = await fetch(`http://localhost:9000/api/users/${user.id}/location`, {
                    method: 'PATCH',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    body: JSON.stringify({
                        latitude: location.coordinates[0],
                        longitude: location.coordinates[1],
                    }),
                });

                if (response.ok) {
                    const updatedUser = await response.json();
                    setUser(updatedUser.user);
                    console.log('Location updated successfully');
                } else {
                    console.error('Failed to update location');
                }
            }
        } catch (error) {
            console.error('Error updating location:', error);
        }
    }, [user, setUser]);

    const handleLogout = () => {
        setUser(null);
        localStorage.removeItem('token');
        navigate('/');
    };

    const handleKeyDown = async (event) => {
        if (event.key === 'Enter') {
            await sendMessage();
        }
    };

    const sendMessage = async () => {
        if (message.trim() !== '') {
            try {
                const location = await getCurrentLocation();

                const messageObject = {
                    text: message,
                    location: location
                };

                const response = await fetch('http://localhost:9000/api/messages/send', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    body: JSON.stringify(messageObject)
                });

                const data = await response.json();
                console.log('Success:', data);
                if (data.success) {
                    setMessages([data.message, ...messages]);
                }
                setMessage('');
            } catch (error) {
                console.error('Error sending message:', error);
            }
        }
    };

    return (
        <div className="container">
            <h2 className="home-header">Home Page</h2>
            <div className="message-input-container">
                <input
                    type="text"
                    value={message}
                    onChange={(e) => setMessage(e.target.value)}
                    placeholder="Type your message..."
                    onKeyDown={handleKeyDown}
                />
                <button onClick={sendMessage}>Send</button>
                <button onClick={handleLogout} className="logout-button">Logout</button>
            </div>

            <div className="messages-container">
                {loading ? (
                    <p className="loading">Loading...</p>
                ) : error ? (
                    <p className="error">Error: {error}</p>
                ) : (
                    messages.map((msg, index) => (
                        <div key={index} className="message">
                            <p>{msg.text}</p>
                            {msg.location && msg.location.coordinates && (
                                <p className="message-location">
                                    Location: {msg.location.coordinates[0]}, {msg.location.coordinates[1]}
                                </p>
                            )}
                        </div>
                    ))
                )}
            </div>
        </div>
    );
};

export default HomePage;
